import './main.css';
import VertiBar from './modules/navigation';
import { BrowserRouter, Route, Routes} from 'react-router-dom';

function App(){
    return (
        <div>
            <table id="layout">
                <tr>
                    <td id="sidebar">
                        <VertiBar />
                    </td>
                    <td id="mbody">
                        hello
                    </td>
                </tr>
            </table>
        </div>
    );
}

export default App;
